import { Button, Divider, List, Paper, Text, Title } from '@mantine/core';
import { Check } from '@phosphor-icons/react/dist/ssr';
import clsx from 'clsx';
import { isNumber } from 'lodash-es';

import { ROUTES } from '@/shared/config';

import s from './TariffCard.module.css';

interface TariffCardProps {
    title: string;
    description: string;
    price: number | string;
    features: {
        title: string;
        description: string;
    }[];
    isFull?: boolean;
    buyNow?: boolean;
}

export const TariffCard = ({
    title,
    features,
    price,
    description,
    isFull = false,
    buyNow = false,
}: TariffCardProps) => (
    <Paper className={clsx(s.tariff, isFull && s.full)}>
        <Title order={5}>{title}</Title>
        <Text mih={63}>{description}</Text>
        <Text className={clsx(s.price, isNumber(price) && s.num)} fw='bold'>
            {price}
        </Text>
        <Divider />
        <List className={s.list} icon={<Check weight='bold' size={24} />}>
            {features?.map((item) => (
                <List.Item key={item.title}>
                    <Text span fw='600'>
                        {item.title}
                    </Text>
                    <Text span>{item.description}</Text>
                </List.Item>
            ))}
        </List>
        <Button component='a' href={buyNow ? '/purchase?type=""' : ROUTES.TEST} variant='outline' className={s.button}>
            {buyNow ? 'Купить сейчас' : 'Пройти тест'}
        </Button>
    </Paper>
);

